script: |
  super -f text -I q5679.spq | sort > q5679.out

inputs:
  - name: q5679.spq
    data: |
      SELECT - 10, + col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 * col0 >= + - 38 * CAST ( NULL AS INTEGER ) + + col1 + - 57;
  - name: tab2

outputs:
  - name: q5679.out
    data: |
